solution:
Let $h = AD.$

[asy]
unitsize(0.3 cm);

pair A, B, C, D;

A = (3,11);
B = (0,0);
D = (3,0);
C = (20,0);

draw(A--B--C--cycle);
draw(A--D);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, S);
label("$3$", (B + D)/2, S);
label("$17$", (C + D)/2, S);
label("$h$", (A + D)/2, E);
[/asy]

Then $\tan \angle BAD = \frac{3}{h}$ and $\tan \angle CAD = \frac{17}{h},$ so
\begin{align*}
\tan A &= \tan (\angle BAD + \angle CAD) \\
&= \frac{\tan \angle BAD + \tan \angle CAD}{1 - \tan \angle BAD \cdot \tan \angle CAD} \\
&= \frac{\frac{3}{h} + \frac{17}{h}}{1 - \frac{3}{h} \cdot \frac{17}{h}} \\
&= \frac{20h}{h^2 - 51}.
\end{align*}Thus, $\frac{20h}{h^2 - 51} = \frac{22}{7}.$  This simplifies to
\[11h^2 - 70h - 561 = 0,\]which factors as $(h - 11)(11h + 51) = 0.$  Hence, $h = 11,$ and the area of triangle $ABC$ is $\frac{1}{2} \cdot 20 \cdot 11 = \boxed{110}.$

We have that
\begin{align*}
\frac{\tan^2 20^\circ - \sin^2 20^\circ}{\tan^2 20^\circ \sin^2 20^\circ} &= \frac{\frac{\sin^2 20^\circ}{\cos^2 20^\circ} - \sin^2 20^\circ}{\frac{\sin^2 20^\circ}{\cos^2 20^\circ} \cdot \sin^2 20^\circ} \\
&= \frac{\sin^2 20^\circ - \cos^2 20^\circ \sin^2 20^\circ}{\sin^4 20^\circ} \\
&= \frac{1 - \cos^2 20^\circ}{\sin^2 20^\circ} = \boxed{1}.
\end{align*}

problem:
$\triangle PQR$ has an area of $27\,\text{cm}^2$ and a base measuring $6$ cm. What is the height, $h,$ of $\triangle PQR?$ [asy]
draw((0,0)--(6,0)--(4,9)--cycle);
draw((4,.5)--(4.5,.5)--(4.5,0));
draw((4,9)--(4,0));
label("$h$",(4,4.5),E);
label("$Q$",(0,0),W);
label("$R$",(6,0),E);
label("$P$",(4,9),N);
label("6 cm",(3,0),S);
[/asy]

solution:
We can expand the determinant as follows:
\begin{align*}
\begin{vmatrix} 2 & 0 & -1 \\ 7 & 4 & -3 \\ 2 & 2 & 5 \end{vmatrix} &= 2 \begin{vmatrix} 4 & -3 \\ 2 & 5 \end{vmatrix} + (-1) \begin{vmatrix} 7 & 4 \\ 2 & 2 \end{vmatrix} \\
&= 2((4)(5) - (-3)(2)) - ((7)(2) - (4)(2)) \\
&= \boxed{46}.
\end{align*}

The vector pointing from $\begin{pmatrix} 5 \\ 3 \\ 5 \end{pmatrix}$ to $\begin{pmatrix} 3 \\ 5 \\ 1 \end{pmatrix}$ is $\begin{pmatrix} -2 \\ 2 \\ -4 \end{pmatrix}.$  Scaling, we can take $\mathbf{n} = \begin{pmatrix} 1 \\ -1 \\ 2 \end{pmatrix}$ as the normal vector of plane $P.$  Thus, the equation of plane $P$ is
\[x - y + 2z = 0.\](We know that the constant is 0, because the plane passes through the origin.)

Let $\mathbf{v} = \begin{pmatrix} 4 \\ 0 \\ 7 \end{pmatrix},$ and let $\mathbf{p}$ be its projection onto plane $P.$  Note that $\mathbf{v} - \mathbf{p}$ is parallel to $\mathbf{n}.$

[asy]
import three;

size(160);
currentprojection = perspective(6,3,2);

triple I = (1,0,0), J = (0,1,0), K = (0,0,1);
triple O = (0,-0.5,0), V = (0,1.5,1), P = (0,1.5,0);

draw(surface((2*I + 2*J)--(2*I - 2*J)--(-2*I - 2*J)--(-2*I + 2*J)--cycle),paleyellow,nolight);
draw((2*I + 2*J)--(2*I - 2*J)--(-2*I - 2*J)--(-2*I + 2*J)--cycle);
draw((P + 0.1*(O - P))--(P + 0.1*(O - P) + 0.2*(V - P))--(P + 0.2*(V - P)));
draw(O--P,green,Arrow3(6));
draw(O--V,red,Arrow3(6));
draw(P--V,blue,Arrow3(6));
draw((1,-0.8,0)--(1,-0.8,0.2)--(1,-1,0.2));
draw((1,-1,0)--(1,-1,2),magenta,Arrow3(6));

label("$\mathbf{v}$", V, N, fontsize(10));
label("$\mathbf{p}$", P, S, fontsize(10));
label("$\mathbf{n}$", (1,-1,1), dir(180), fontsize(10));
label("$\mathbf{v} - \mathbf{p}$", (V + P)/2, E, fontsize(10));
[/asy]

Thus, $\mathbf{v} - \mathbf{p}$ is the projection of $\mathbf{v}$ onto $\mathbf{n}.$  Hence,
\[\mathbf{v} - \mathbf{p} = \frac{\begin{pmatrix} 4 \\ 0 \\ 7 \end{pmatrix} \cdot \begin{pmatrix} 1 \\ -1 \\ 2 \end{pmatrix}}{\begin{pmatrix} 1 \\ -1 \\ 2 \end{pmatrix} \cdot \begin{pmatrix} 1 \\ -1 \\ 2 \end{pmatrix}} \begin{pmatrix} 1 \\ -1 \\ 2 \end{pmatrix} = \frac{18}{6} \begin{pmatrix} 1 \\ -1 \\ 2 \end{pmatrix} = \begin{pmatrix} 3 \\ -3 \\ 6 \end{pmatrix}.\]Then
\[\mathbf{p} = \mathbf{v} - \begin{pmatrix} 3 \\ -3 \\ 6 \end{pmatrix} = \boxed{\begin{pmatrix} 1 \\ 3 \\ 1 \end{pmatrix}}.\]

We draw the longest altitude of this triangle, which breaks the triangle into two right triangles.   [asy]
size(100);
pair A,B,C,D;
A=(0,0); B=(8,0); C=(4,sqrt(65)); D=(4,0);
draw(A--B--C--cycle); draw(C--D);
draw(rightanglemark(C,D,A,18));
label("8",D,S); label("9",(A+C)/2,W); label("9",(B+C)/2,E);
[/asy] The right triangles are congruent because the original triangle is isosceles; each right triangle has one leg length $8/2=4$ and hypotenuse length 9.  The other leg, which is also the height of the original triangle, has length $\sqrt{9^2-4^2}=\sqrt{65}$.  Thus, the original triangle has base length 8, height $\sqrt{65}$, and area \[\frac{1}{2}(8)(\sqrt{65})=\boxed{4\sqrt{65}}.\]

problem:
Wanda is trying to locate the Fermat point $P$ of $\triangle ABC$, where $A$ is at the origin, $B$ is at $(8,-1)$, and $C$ is at $(5,4)$ (the Fermat point is the point such that the sum of its distances from the vertices of a triangle is minimized). She guesses that the point is at $P = (4,2)$, and computes the sum of the distances from $P$ to the vertices of $\triangle ABC$. If she obtains $m + n\sqrt{5}$, where $m$ and $n$ are integers, what is $m + n$?

[asy]
string sp(pair P1, string P2){return "$" + P2 + "\,(" + string(P1.x) + "," + string(P1.y) + ")$";}
size(150); defaultpen(fontsize(10)); draw((-3,0)--(10,0),Arrows(4)); draw((0,-3)--(0,8),Arrows(4)); pair A=(0,0),B=(8,-1),C=(5,4),P=(4,2); draw(A--B--C--cycle, linewidth(0.7)); draw(A--P, dashed); draw(B--P, dashed); draw(C--P, dashed); label(sp(A,"A"),A,NW); label(sp(B,"B"),B,S); label(sp(C,"C"),C,N); label(sp(P,"P"),P,(-0.5,-2.8)); dot(A); dot(B); dot(C); dot(P);
[/asy]

solution:
By the distance formula,  \begin{align*}
AP &= \sqrt{(4-0)^2 + (2-0)^2} = \sqrt{16 + 4} = 2\sqrt{5} \\
BP &= \sqrt{(4-8)^2 + (2-(-1))^2} = \sqrt{16 + 9} = 5 \\
CP &= \sqrt{(4-5)^2 + (2-4)^2} = \sqrt{1+4} = \sqrt{5}
\end{align*}Hence, $AP + BP + CP = 5 + 3\sqrt{5}$, and $m+n = \boxed{8}$.

problem:
$P$ is the midpoint of $\overline{BD}$. $AP = BP = 4$, $\overline{AP} \perp \overline{BD}$, $\overline{BD} \perp \overline{DC}$, $\overline{AB} \perp \overline{BC}$. In simple radical form, what is the perimeter of pentagon $ABCDP$? [asy]
size(150); defaultpen(linewidth(0.8)); import geometry;
pair A = origin, B = (4,4), C = (12,-4), D = (4,-4), P = (4,0);
draw(A--P--B--cycle);
draw(B--D--C--cycle);
draw(rightanglemark(A,B,C,15));
draw(rightanglemark(A,P,B,15));
draw(rightanglemark(B,D,C,15));
label("$A$",A,SW); label("$B$",B,N); label("$C$",C,SE); label("$D$",D,SW); label("$P$",P,E); label("$4$",A--P,S); label("$4$",B--P,E);

[/asy]

solution:
Let the triangle be $ABC,$ where $\angle A = \alpha$ and $\angle C = 90^\circ.$  Let $\overline{AD}$ and $\overline{AM}$ be the angle bisector and median from $A,$ respectively.

[asy]
unitsize(8 cm);

pair A, B, C, D, M;

C = (0,0);
B = (Cos(13.1219),0);
A = (0,Sin(13.1210));
D = extension(A, incenter(A,B,C), B, C);
M = (B + C)/2;

draw(A--B--C--cycle);
draw(A--D);
draw(A--M);

label("$A$", A, N);
label("$B$", B, E);
label("$C$", C, SW);
label("$D$", D, S);
label("$M$", M, S);
[/asy]

Since $A = 2 \alpha,$
\[\tan A = \tan 2 \alpha = \frac{2 \tan \alpha}{1 - \tan^2 \alpha} = \frac{2 \cdot \frac{1}{\sqrt[3]{2}}}{1 - \frac{1}{\sqrt[3]{4}}} = \frac{2^{4/3}}{2^{2/3} - 1}.\]Now, since $M$ is the midpoint of $\overline{BC},$
\[\tan \angle CAM = \frac{1}{2} \tan A = \frac{2^{1/3}}{2^{2/3} - 1}.\]Therefore,
\begin{align*}
\tan \theta &= \tan \angle DAM \\
&= \tan (\angle CAM - \angle CAD) \\
&= \frac{\tan \angle CAM - \tan \angle CAD}{1 + \tan \angle CAM \cdot \tan \angle CAD} \\
&= \frac{\frac{2^{1/3}}{2^{2/3} - 1} - \frac{1}{2^{1/3}}}{1 + \frac{2^{1/3}}{2^{2/3} - 1} \cdot \frac{1}{2^{1/3}}} \\
&= \frac{2^{2/3} - (2^{2/3} - 1)}{2^{1/3} \cdot (2^{2/3 - 1} - 1) + 2^{1/3}} \\
&= \boxed{\frac{1}{2}}.
\end{align*}

problem:
In the diagram shown here (which is not drawn to scale), suppose that $\triangle ABC \sim \triangle PAQ$ and $\triangle ABQ \sim \triangle QCP$.  If $m\angle BAC = 70^\circ$, then compute $m\angle PQC$. [asy]
size(150); defaultpen(linewidth(0.8));
pair B = (0,0), C = (6,0), A = (2,4), Q = (1,0), P = (A + C)/2;
draw(A--B--C--A--Q--P);
label("$B$",B,S); label("$A$",A,N); label("$C$",C,S); label("$P$",P,E); label("$Q$",Q,S);
[/asy]
